import React, { useState } from 'react';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  NavbarText
} from 'reactstrap';

const NavBar = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  return (
    <div >
      <Navbar  color="white"   expand="md">
        <NavbarBrand href="/">reactstrap</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav  navbar>
            <NavItem>
              <NavLink className="nav-style" href="/components/">Components</NavLink>
            </NavItem>
            <NavItem>
              <NavLink className="nav-style" href="https://github.com/reactstrap/reactstrap">GitHub</NavLink>
            </NavItem>
         
          </Nav>
          <NavbarText>Simple Text</NavbarText>
        </Collapse>
      </Navbar>

  <style jsx global>{`
  
  .nav-style{
      color:black
  }
        
  
  `}</style>
    </div>


  );
}

export default NavBar;
